import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ChevronService {

  constructor(private http: HttpClient) {


  }
  AddPerson(data: any) {

    const dataone = { Name: data.name, Address: data.address, Email: data.email }
    console.log(dataone)
    this.http.post("https://localhost:7240/api/Persons", dataone);
  }
  GetPerson() {
    return this.http.get("https://localhost:7240/api/Persons");
  }

}
